import Header from './Header';
import Head from 'next/head';

const layoutStyle = {
    margin: 20,
    padding: 20,
    border: '1px solid #DDD',
};

const Layout = props => (
    <div style={layoutStyle}>
        <head>
            <title>IntelliShip</title>
            <link rel="stylesheet"
            href="https://bootswatch.com/4/lux/bootstrap.min.css"/>
        </head>
      <Header />
      {props.children}
    </div>
  );

export default Layout;
